  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Snake Creek National
  Wildlife Refuge outlines Refuge accomplishments from August through October of 1939.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds and upland game
  birds- is also covered. The Refuge development and maintenance section discusses
  vegetation control. The public relations section of the report describes hunting.\",\n\t\"owner_org\":
